const Header = () => {
  return (
    <>

      
      <div className={styles.dp_flex}>
        
        <a className={styles.borda} href="/">
          Home
        </a>
        <a className={styles.borda} href="/">
          Produtos
        </a>
        <a className={styles.borda} href="/">
          Sobre
        </a>
      </div>
    </>
  );
};

export default Header;
